import React, { Component } from "react";

class Sinopse extends Component {
  render() {
    return (
      <div className="Sinopse">
        <h1 className="title">Sinopse</h1>
        <p>
          As borboletas monarca (Danaus plexippus) pertencem à ordem Lepidoptera
          e à classe Insecta, dando título a este espetáculo. A vida destas
          borboletas pode ser extremamente curta, durante apenas poucas semanas,
          mas durante este curto período sofrem uma metamorfose extraordinária e
          efetuam uma das grandes e mais notáveis migrações de toda a classe dos
          insetos. Para isto, apresentam um excelente sentido de orientação que
          é comparado a um compasso natural, auxiliando as borboletas na sua
          migração.
        </p>
      </div>
    );
  }
}

export default Sinopse;
